description:
Starring: Alexis Texas, Kristina Rose, Gracie Glam, Asa Akira.

Get ready for a clash of the titans! &quot;Buttwoman&quot; Alexis Texas goes head to head with &quot;Slutwoman&quot; Kristina Rose! They follow in the footsteps of industry icons Tiffany Mynx, Tianna, Alexandra Quinn, and Roxanne Hall in these classic Elegant Angel roles. Watch the collosal posterior of Alexis Texas combine with the passion and depravity of Kristina Rose in five unforgettable hardcore scenes. Directed by the multi-award winning, Mason.

